	public void draw(Graphics buffer, int width, int height){
		buffer.setColor(color);
		buffer.fillOval(width/2-radius, height/2-radius, 2*radius, 2*radius);
		buffer.setColor((new Proton()).getColor());
		drawProtons(buffer, width/2, height/2);
		buffer.setColor((new Electron()).getColor());
		drawElectrons(buffer, width/2, height/2);
	}

	private ArrayList<Proton> getProtons(int x1, int y1) {
		ArrayList<Proton> r = new ArrayList<>();
		for(int i=0; i<packData[protonNum].getNum(); i++) {
			r.add(new Proton((int)(x1+packData[protonNum].getXCoords()[i]*radius),
							 (int)(y1+packData[protonNum].getYCoords()[i]*radius),
							 (int)(packData[protonNum].getRadius()*radius)));
		}
		return r;
	}
	
	private void drawProtons(Graphics buffer, int x1, int y1) {
		for(Proton p : getProtons(x1, y1)) {
			buffer.fillOval(p.getX()-p.getRadius(), p.getY()-p.getRadius(),
							2*p.getRadius(), 2*p.getRadius());
		}
	}
	
	class CirclePack {
		private int circleNum;
		private double[] xCoords, yCoords;
		private double radius;
		public CirclePack(int circleNum, double[] xCoords, double[] yCoords, double radius) {
			this.circleNum = circleNum;
			this.xCoords = xCoords;
			this.yCoords = yCoords;
			this.radius = radius;
		}
		public int getNum() {
			return circleNum;
		}
		public double[] getXCoords() {
			return xCoords;
		}
		public double[] getYCoords() {
			return yCoords;
		}
		public double getRadius() {
			return radius;
		}
	}
	
	private ArrayList<Electron> getElectrons(int x1, int y1) {
		ArrayList<Electron> r = new ArrayList<>();
		int electronRadius = (int)((new Electron()).getRadius()/electronRatio);
		int totalRadius = radius+electronRadius;
		int count = 0;
		
		for(int i=1; count<electronNum; i++) {
			for(double j=0; count<electronNum && j<2*Math.PI; j+=2*Math.PI/(2*i*i)) {
				count++;

				r.add(new Electron((int)(x1+totalRadius*Math.cos(j-Math.PI/2)),
						(int)(y1+totalRadius*Math.sin(j-Math.PI/2)), electronRadius));
			}
			totalRadius += 2*electronRadius;
		}
		return r;
	}
	private void drawElectrons(Graphics buffer, int x1, int y1) {
		for(Electron e : getElectrons(x1,y1)) {
			buffer.fillOval(e.getX()-e.getRadius(), e.getY()-e.getRadius(),
							2*e.getRadius(), 2*e.getRadius());
		}
	}
	
